import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { Router, Route , Switch } from 'react-router-dom';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
        <Switch>
          <Route exact path='/' component={<App />}/>
        </Switch>
    </Router>
  </React.StrictMode>
);
